import "./Profile.css";
import {Link} from "react-router-dom";



function Profile() {
    return (
        <section className="Profile">
            <form className="form" noValidate>
            <div className="form__fields">
                <h2 className="form__title">Привет, Виталий!</h2>

                <label className="form__label">Имя</label>
                <input minLength="2" maxLength="30" required type="text" name="username" className="form__input">Виталий</input>
                <span className="form__error"></span>

                <label className="form__label">E-mail</label>
                <input required type="email" className="form__input" name="email"></input>
                <span className="form__error"></span>
            </div>
            {/* <div className="form__submit"> */}
                <div className="form__link-row form__link-row_profile">
                    <Link to="" className="form__link">Редактировать</Link>
                    <Link to="" className="form__link">Выйти из аккаунта</Link>
                </div>
            {/* </div> */}
            </form>
    </section>
    )
}

export default Profile;
